function ExpenseDate(props){

    const dateDay=props.date.toLocaleString('en-US', {day: '2-digit'});
    const dateMonth=props.date.toLocaleString('en-US', {month: 'long'});
    const dateYear=props.date.getFullYear();

    return (
        <div>
            <div>{dateMonth}</div>
            <div>{dateDay}</div>
            <div>{dateYear}</div>
        </div>
    );

}
